window.bookSummaryJSON = "<p><b>In Jim’s absence, Zorlando has been doing a pretty good job keeping Windfall safe. </b></p> <p>He doesn’t know - and may not be equipped for - what is heading straight toward Noobtown, though. Will Jim beat the Pirates while he is on Glorious Roberts’ ship? Will he make it back to his beloved city before Maggie, the assassin, gets there? Why are there pirates attempting to sack Windfall? Most importantly, will Shart ever be the opposite of inside out again?&nbsp;</p> <p>All these questions may or may not be answered in the sixth book of the best-selling Noobtown LitRPG series.&nbsp;</p> <p><i>(They will.)</i></p>"; 
